INSERT INTO `jena_long_lit` VALUES (1,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn explicit individual academic term, quarter, or se:',3805980422,'mester (e.g., Fall 2009)'),(2,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringUse when both year and month are known, but not day :',1387930270,'of the month or time'),(3,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn organized series of events, typically put on by a:',1760046318,' department or center; use Seminar for each individual talk'),(4,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAmerican Samoa; Anguilla; Aruba; Guadeloupe; Puerto :',561103573,'Rico; United States Virgin Islands'),(5,'Lv:0:39:http://www.w3.org/2001/XMLSchema#string\"The United Nations list of Non-Self-Governing Terri:',2307442562,'tories is a list of countries that, according to the United Nations, are non-decolonized.\" \"Decolonization can be achieved by attaining independence, integrating with the administering power or another state, or establishing a \"free association\" status\" - Source Wikipedia starting here http://en.wikipedia.org/wiki/United_Nations_list_of_Non-Self-Governing_Territories. (PM)'),(6,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringCountries that, according to the United Nations, are:',592399245,' non-decolonized.'),(7,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringPlease select or add the University or independent C:',2565633865,'ollege that granted this degree'),(8,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringUse for time values independent of date; e.g., time :',545019637,'that a course section starts every day it is offered'),(9,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA position classified as professional, staff, suppor:',2211649698,'t, or any other non-academic role'),(10,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringTerritories not belonging to self-governing, non-sel:',402973139,'f-governing, and disputed classes.'),(11,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringShort description taken from Wikipedia http://en.wik:',8630738,'ipedia.org/wiki/Geopolitical_ontology. (PM)'),(12,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringCollaborator at Local University; Collaborator at co:',313265423,'nsortium institution'),(13,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn individual involved with the PI in the scientific:',3993332572,' development or execution of a project. The co-investigator (collaborator) may be employed by, or be affiliated with, the applicant/grantee organization or another organization participating in the project under a consortium agreement. A co-investigator typically devotes a specified percentage of time to the project and is considered key personnel. The designation of a co-investigator, if applicable, does not affect the PIs roles and responsibilities. From Glossary of NIH Terms. (MT)'),(14,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringIndividual designated by the grantee to direct the p:',4144612181,'roject or activity being supported by the grant. He or she is responsible and accountable to the grantee for the proper conduct of the project or activity. Also known as Program Director or Project Director.'),(15,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn outreach or community service activity directed o:',2323243260,'utside a person\'s primary profession and institution'),(16,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAdministrative Official reviews the grant applicatio:',2323805228,'n for accuracy before the signing official submits the final application. May be the same person as the signing official. Resides in either the central research administration office or academic departments. From the Glossary of NIH Terms. (MT)'),(17,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAdministrative official, central research administra:',1144182304,'tion office, or academic department contact'),(18,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn article of opinion, typically published in a news:',3408600138,'paper. For academics, most commonly Op Ed pieces'),(19,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringWe can\'t yet assume that we will only have a single :',1125043606,'ORCID id for a person'),(20,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringIndicate general availability or accessibility, not :',3132810390,'necessarily management or control'),(21,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringFood and Agriculture Organization of the United Nati:',1901815975,'ons (FAO)'),(22,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringShort description take from Wikipedia http://en.wiki:',1154443726,'pedia.org/wiki/Geopolitical_ontology. (PM)'),(23,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringIf applicable, please enter your preferred salutatio:',36445114,'n (e.g., Mr./Ms./Mrs./Dr./Hon.)'),(24,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringUse for time independent of date, as for a repeating:',1273125167,' event'),(25,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringUse for reviews, book chapters, or publications wher:',1375918294,'e no separate entry (individual resource) will be created for the related publication'),(26,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA person may at any one time have more than 1 resear:',863077884,'cher id due to a change in affliation; when the conflict is resolved, the old one should be deleted, but we can\'t treat this as a functional property'),(27,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA person not considered a faculty member but holding:',3023685907,' an academic appointment'),(28,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringEnter \'true\' if the talk or presentation was referee:',817361994,'d prior to acceptance; enter \'false\' or leave blank if not refereed'),(29,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringNo definition was found of this specific class. It\'s:',3410421373,' probably not meant for use in classifying areas.  A subclass should be selected. (PM)'),(30,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA type of geopolitical area. Not meant for use. Use :',3956840736,'subclasses within.'),(31,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringFinancial assistance mechanism providing money, prop:',3226145010,'erty, or both to an eligible entity to carry out an approved project or activity'),(32,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringShort definition is from the Glossary of NIH Terms. :',1730660871,'Consider using Local Award ID data property for intramural (internal) grants and Sponsor Award ID for extramural (external) grants. (MT)'),(33,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn intramural or extramural award to support scholar:',1318862206,'ly work'),(34,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringTotal pages: use start page and end page for page ra:',1721974253,'nges'),(35,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringPlease enter the total number of pages -- use start :',1524576215,'page and end page to express a range'),(36,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringPlease enter a whole number (between -2147483648 and:',504748360,' 2147483647)'),(37,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn individual collaborator who typically devotes a s:',1706771871,'pecified percentage of time to the project and is considered key personnel'),(38,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringUse for teaching experiences other than specific for:',2227892257,'-credit courses within a person\'s home institution'),(39,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringThe period considered by an academic institution to :',3501300308,'be its primary academic cycle'),(40,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringThe ongoing concept of a course, typically then give:',2143222646,'n repeatedly in a specific semester as a Course Section'),(41,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringNational Institutes of Health; Local University Smal:',3749839730,'l Grant Program'),(42,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringPublic Description and Example entered by MT - delet:',1281036859,'e this entire Description after second review.'),(43,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA section of a Course taught by 1 or more people, in:',2831926908,' a semester, at a time, in a place'),(44,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA short written piece focused on an event or announc:',2190921948,'ement of note, having a defined publication time and of less enduring interest than a news feature.'),(45,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringPlease enter your full official work email address t:',2823481667,'o be used for directory listings -- use alternate email for personal or other professional email addresses'),(46,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA group of independent organizations working togethe:',3779373395,'r toward a common goal.'),(47,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringIntramural or extramural agency awarding the grant a:',1081534842,'nd providing money or property or both to the grant recipient'),(48,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA group of people organized for a specific purpose (:',2194246106,'e.g., a reporting or advisory role), often with a charge and for a specific duration'),(49,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringThere could be many subclasses such as thesis commit:',2394005640,'tee or tenure committee, but these may typically be differentiated via the moniker unless distinct properties become important'),(50,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringShort description take from Wikipedia http://en.wiki:',2866702130,'pedia.org/wiki/Geopolitical_ontology. Example also take from this Wikipedia page.  (PM)'),(51,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringUse when a single year-month value is appropriate ra:',1303158982,'ther than a separate start and end'),(52,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA lab providing services such as training, protocols:',2619296096,', or access to instruments or software'),(53,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA generic class encompassing several types of activi:',2747332969,'ties frequently reported on CVs or in annual reporting systems'),(54,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA unit devoted primarily to extension activities, wh:',4024543338,'ether for outreach or research'),(55,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn award, honor, or distinction received by a person:',1732084980,' on a particular date (not the award itself as given repeatedly, and not a grant award)'),(56,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringDistinct from the organization that runs it; e.g., a:',2728933986,' laboratory may be an organization but may be run by another organization and only consist of facilities housing equipment or services '),(57,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA building or place that provides a particular servi:',3114247000,'ce or is used for a particular activity'),(58,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringThis property will normally be populated through aut:',484298672,'omated date ingest only.'),(59,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringIndicate the source of flow-through funding, as for :',2150085889,'a subcontract.'),(60,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringA short form for an academic degree for use in the c:',260637919,'oncatenated educational background listing for a person; hence declared functional even though there could be more than 1 degree abbreviation found or there could be alternative language formats'),(61,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringEnter the single preferred abbreviation for this deg:',2372300569,'ree'),(62,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringOptionally link this activity with an information re:',2208164898,'source such as a publication, thesis, or the like'),(63,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAn academic administrative position (associate dean,:',2366239724,' etc.) as distinct from