nization, and publicity'),(150,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringprimary bibliographic properties of publications to :',1442438914,'prioritize in display'),(151,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringsupplemental information not intended for public dis:',3804594899,'play (e.g, alternative name versions)'),(152,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringreference information to online content, translation:',1011158423,'s, etc.'),(153,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringbiographical information about a person, past or pre:',3133418153,'sent'),(154,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringAppointments and other formally-defined employment r:',1676747141,'elationships'),(155,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringBibliographic properties in other namespaces mapped :',2814803958,'within VIVO core'),(156,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringProperties included in VIVO core to support mappings:',3609857389,' to other ontologies'),(157,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringobscure bibontology properties not likely to be used:',3941250501,' in VIVO'),(158,'Lv:0:39:http://www.w3.org/2001/XMLSchema#stringsecondary properties of a bibliographic citation ind:',1991748423,'icating where to find it'),(159,'Lv:0:39:http://www.w3.org/2001/XMLSchema#string<p>The VIVO National Network enables the discovery o:',2032005026,'f researchers across institutions. Participants in the network include institutions with local installations of VIVO or those with research discovery and profiling applications that can provide semantic web-compliant data. The information accessible through VIVO\'s search and browse capability will therefore reside and be controlled locally, within institutional VIVOs or other semantic web-compliant applications.</p>\n\n\n\n<p>VIVO is an open source semantic web application originally developed and implemented at Cornell. When installed and populated with content at an institution, it enables the discovery of research and scholarship across disciplines at that institution. VIVO supports browsing and a search function which returns faceted results for rapid retrieval of desired information. Content in any local VIVO installation may be maintained manually or brought into the database in automated ways from local systems of record, such as HR, grants, course, and faculty activity databases.</p>\n\n\n\n<p>See more information on the <a href=\"http://vivoweb.org\">VIVO Project</a>.</p>'),(160,'Lv:0:39:http://www.w3.org/2001/XMLSchema#string<h3>Welcome! You have successfully installed VIVO!</:',109898848,'h3>\n\n<p>Your next step is to <a href=\"siteAdmin?home=1&login=block\">login</a> and change your password. You can find the login link in the header on the right above.</p>\n\n<p>Please see the <a href=\"http://vivoweb.org/support/user-guide\" target=\"_blank\">VIVO User Guide</a> for help.  The user guide includes information on <a href=\"siteAdmin?home=1\">Site Administration</a>.  You may want to read about the <a href=\"http://vivoweb.org/support/user-guide/site-configuration\" target=\"_blank\">Site Configuration</a> topics next:</p>\n<ul>\n<li><a href=\"http://vivoweb.org/support/user-guide/site-information\" target=\"_blank\">Edit site information</a></li>\n<li><a href=\"http://vivoweb.org/support/user-guide/tab-management\" target=\"_blank\">Manage tabs</a></li>\n<li><a href=\"http://vivoweb.org/support/user-guide/managing-user-accounts\" target=\"_blank\">Manage user accounts</a></li>\n</ul>');
